class Sidebar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <div>
        <i class="fab fa-linkedin" />
        <button id="home" />
        <button id="skills" />
        <button id="" />
        <button />
      </div>
    );
  }
}

export default Sidebar;
